import React, { Component } from "react";

import "tabler-react/dist/Tabler.css";

import { Nav, Site, Page, Button, Grid, Table } from "tabler-react";

class App extends Component {
  render() {
    return (
      <Site>
        <Nav>
          <Nav.Item hasSubNav value="DashBoard" icon="globe" />
        </Nav>
        <Page.Content title="DashBoard">
          <Grid>
            <Table>
              <Table.Header>
                <Table.ColHeader>Tag</Table.ColHeader>
                <Table.ColHeader>Log Time</Table.ColHeader>
                <Table.ColHeader>Message</Table.ColHeader>
              </Table.Header>
              <Table.Body>
                <Table.Row>
                  <Table.Col>Error</Table.Col>
                  <Table.Col>2018-11-30</Table.Col>
                  <Table.Col />
                </Table.Row>
              </Table.Body>
            </Table>
          </Grid>
        </Page.Content>
      </Site>
    );
  }
}

export default App;
